        return (
            <div>
            <div className=" hide-mob" id="cardOne"> <CardFlav /> </div>
            <div className=" hide-mob" id="cardTwo"> <CardTea /> </div>
            <div className=" hide-mob" id="cardThree"> <CardHow /> </div>
            </div>
        )
    }

};
